import React from "react";
import noimage from "../noimage.png";

class Details extends React.Component {
  render() {
    let book = this.props.book;
    return (
      <div className="col-sm-3">
        <img
          src="http://books.google.com/books/content?id=czQ1DwAAQBAJ&amp;printsec=frontcover&amp;img=1&amp;zoom=1&amp;edge=curl&amp;source=gbs_api"
          height="170px"
          width="130px"
          alt={noimage}
        />
        <p className="person-name">Title: {book.volumeInfo.title}</p>
        <ul>
          <li>Publisher: {book.volumeInfo.publisher}</li>
          <li>{book.volumeInfo.pageCount} pages</li>
        </ul>
      </div>
    );
  }
}

export default Details;
